import React from 'react'
import './App.css'

const Header = () =>{
    return(
        <>
            <div className="main-heading">
                    <h1 className="mb-5 text-center headerd "> <span className=" text-danger text-uppercase "> INDIA </span> COVID-19 Dashboard</h1>
                </div>
        </>
    )
}

export default Header;
